import React from "react";
import Navbar from "../../components/Navbar";
import "./CreateQuiz.css";
import { useState } from "react";

export default function CreateQuiz() {
  const [quizname, setQuizName] = useState("");
  const [buttonPopUp, setButtonPopup] = useState(false);

  return (
    <div>
       <Navbar></Navbar>
      <main>
        <div class="QuizCreate">
          <div class="QuizName">
            <input type="Quizz-name" value={quizname} onChange={(e) => { setQuizName(e.target.value)}}></input>
          </div>
          <div class="QuizType">
            <p>Quiz Type</p>
              <button type="submit" class="Q&A" >Q & A</button>
              <button type="submit" class="Poll Type" >Poll Type</button>
          </div>
          <div class="G+"></div>
        </div>
      </main>
    </div>
  );
}
